# Helper functions
def isSlowpoke(playerName, playerclass):
    if playerName == "slowpoke":
        playerclass.loadWeights(slowpoke_coefficents)
    return playerclass

def generatePlayerOptions(plyCount=4):
    playerTypes = {
        'magikarp' : {
            "description" : "It plays randomly.",
            "class" : ma.Magikarp()
        },
        'human' : {
            "description" : "Human player.",
            "class" : human.Human()
        },
        'slowpoke' : {
            "description" : "Slowpoke is a bot.",
            "class" : sp.Slowpoke(plyCount)
        },
    }
    return playerTypes


# -----------------

# load agents

def handleArguments():
    print(sys.argv)
    # check if "b=" is in one of the arguments

    blackPlayer = None
    whitePlayer = None

    custom_ply = 4
    # here we loop once to find the ply if it exists.
    for i in sys.argv:
        if "ply=" in i:
            # print("ply detected")
            custom_ply = int(i.replace("ply=", ""))

            if custom_ply > 1:
                # load it. 
                print("Loading custom ply", custom_ply)
                ply = custom_ply

    playerTypes = generatePlayerOptions(custom_ply)
    # here we loop to generate agents.
    for i in sys.argv:
        if "b=" in i:
            # black player detected
            title = i.replace("b=", "").lower()
            player = playerTypes[title]['class']
            player = isSlowpoke(title,player)
            player = agent.Agent(player)
            blackPlayer = (player, title)
        if "w=" in i:
            # white player detected
            title = i.replace("w=", "").lower()
            player = playerTypes[title]['class']
            player = isSlowpoke(title,player)
            player = agent.Agent(player)
            whitePlayer = (player,title)
            
    # check if they're still null values.
    if blackPlayer == None:
        blackPlayer = loadPlayer({'colour':"Black"})
    if whitePlayer == None:
        whitePlayer = loadPlayer({'colour':"White"})

    return blackPlayer, whitePlayer

def loadPlayer(options={}):
    
    print("Who will be the", options['colour'], "player?")
    if options['colour'] == "Black":
        print("Note that Black plays first.")
    if options['colour'] == "White":
        print("White player plays second.")
    print()

    playerTypes = generatePlayerOptions()

    player = None
    while player == None:
        for i in playerTypes.keys():
            print(i, "-", playerTypes[i]['description'])
        
        print()
        resp = input("Player:").lower()
        if resp in playerTypes.keys():
            player = resp
        else:
            print(resp, "is not a recognised agent. Try again.")

    playerClass = playerTypes[player]['class']
    # add coefficents if its a slowpoke.
    playerClass = isSlowpoke(player,playerClass)

    
    # load the agent who will play this.
    print()
    return (agent.Agent(playerClass), player)

def initiateAgents():
    """
    Loads white and black agents so we can play the game.
    """
    blackAgent = loadPlayer({'colour':"Black"})
    whiteAgent = loadPlayer({'colour':"White"})
    return (blackAgent, whiteAgent)

def runGame(blackAgent, whiteAgent):
    """
    To be called once players are generated.
    """

    # load the game
    board = game.playGame(blackAgent[0], whiteAgent[0])

    if board.winner == 0:
        print(blackAgent[1], "wins!")
        print(whiteAgent[1], "loses.")
    elif board.winner == 1:
        print(whiteAgent[1], "wins!")
        print(blackAgent[1], "loses.")
    print("This game was generated with a ply count of", ply)
    
if __name__ == "__main__":

    blackAgent, whiteAgent = None, None

    # check if theres any parameters?
    if len(sys.argv) > 1:
        blackAgent, whiteAgent = handleArguments()
    else:
    # theres no parameters.
        blackAgent, whiteAgent = initiateAgents()
    # run when agents are loaded.
    runGame(blackAgent, whiteAgent)